const Web3 = require("web3");
const net = require('net');

let connect = new Web3(new Web3.providers.IpcProvider('/var/lib/bor/data/bor.ipc', net));

connect.extend({
    methods: [{
        name: 'callBundle',
        call: 'eth_callBundle',
        params: 1
    }]
});

let params = {
    txs: [
      '',
      ''
    ],
    blockNumber: 39808072,
    stateBlockNumber: 'pending',
    timestamp: 1677595057
  }
let callBundleResult = await connect.callBundle(params);

console.log(callBundleResult);